import React, { useState, useEffect } from 'react';
import './Homepage.css'
const Homepage = () => {
    const [quote, setQuote] = useState('');

  const fetchQuote = async () => {
    try {
      const response = await fetch('https://catfact.ninja/fact');
      const data = await response.json();
      setQuote(data.fact);
    } catch (error) {
      console.error('Error fetching the quote', error);
    }
  };

  useEffect(() => {
    fetchQuote();

    const intervalId = setInterval(fetchQuote, 60000);

    return () => clearInterval(intervalId); 
  }, []);
  return (
    <div className='qoute-box'>
    <div className='qoute'>
     <h1 className='heading'>Quote #1</h1>
     <p>{quote}</p>
    <button onClick={fetchQuote}> <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="cyan" class="bi bi-repeat" viewBox="0 0 16 16">
<path d="M11 5.466V4H5a4 4 0 0 0-3.584 5.777.5.5 0 1 1-.896.446A5 5 0 0 1 5 3h6V1.534a.25.25 0 0 1 .41-.192l2.36 1.966c.12.1.12.284 0 .384l-2.36 1.966a.25.25 0 0 1-.41-.192m3.81.086a.5.5 0 0 1 .67.225A5 5 0 0 1 11 13H5v1.466a.25.25 0 0 1-.41.192l-2.36-1.966a.25.25 0 0 1 0-.384l2.36-1.966a.25.25 0 0 1 .41.192V12h6a4 4 0 0 0 3.585-5.777.5.5 0 0 1 .225-.67Z"/>
</svg></button>
    </div>
   </div>
  )
}

export default Homepage
